const Footer = () => {
    return (
        <div className="footer-container">
            <p class="footer-heading">Want to get in touch with me?</p>
            <a href="mailto:mollythompsonxox@gmail.com" class="link-block-2 w-inline-block"><p class="footeremail">mollythompsonxox@gmail.com</p></a>
            <div class="footer-links-block"><p class="footerfollowme">Follow me:</p><a href="https://www.linkedin.com/in/molly-thompson-269125207" target="_blank" class="link">Linkedin</a><a href="https://github.com/mollythompsongit" target="_blank" class="link">Github</a></div>
            <p class="footer-developed">Developed by Molly Thompson</p>
        </div>
    )
}

export default Footer
